import React, { Component } from 'react'
import form from 'react-bootstrap';

export class Dataform extends Component {

    constructor(props) {
        super(props)

        this.state = {
            amount: '',
            duration: ''
          }
    }

    render() {
        return (
    <div>
  <form className="form-inline" onSubmit={this.handleSubmit}>
  <div className="form-group mb-2">
    <label htmlFor="inputAmount" className="sr-only">Email</label>
    <input type="text" class="form-control" id="inputAmount" placeholder="Amount" onChange={this.handleChangeAmount} />
  </div>
  <div class="form-group mx-sm-3 mb-2">
    <label htmlFor="inputDuration" className="sr-only">Password</label>
    <input type="text" className="form-control" id="inputDuration" placeholder="Duration" onChange={this.handleChangeDuration}  />
  </div>
  <button type="submit" className="btn btn-primary mb-2">Calculate</button>
</form>
            </div>
        )
    }
}

export default Dataform
